  [128001]={ID=128001,Type=28,ActivityClass=0,Name="宝箱积分活动",Desc="钻石宝箱:40分，黄金宝箱:2分",ActivityDesc="1.活动期间抽取宝箱会得到积分（1次钻石=40分，1次金币=2分）\n2.积分达到宝箱所需的积分后，可以领取宝箱。\n3.活动结束后，界面还会保留一天，尽快领取奖励\n4.排行榜前100名的玩家可以得到排行榜奖励\n5.每次活动结束后，积分将清零",Icon="item_baoxiang_001",StartDate={Year=2016,Month=8,Day=3,},FrontStartDate={Year=2016,Month=8,Day=3,},StopDate={Year=2016,Month=8,Day=9,},FrontStopDate={Year=2016,Month=8,Day=10,},StartTime={Hour=0,Minute=0,Seconds=0,},StopTime={Hour=23,Minute=59,Seconds=59,},Days={1,2,3,4,5,6,7,},LevelRange={Start=1,End=99,},DailyTimes="0",TotalCount="0",Reward={God=0,Gem=0,Reputation=0,Energy=0,Exp=0,Contribution=0,Score=0,},},
