  [130001]={ID=130001,Type=30,ActivityClass=0,Name="幸运轮盘",ActivityDesc="1.在活动期间，右侧抽奖会随机抽取获得奖励和幸运色（红色和黑色）\n2.左侧转盘主要是奖励翻倍的提示，最高奖励可返5倍哦，翻倍条件为，\n右侧抽取的幸运色和转盘指针所指颜色相同，那么转盘指针指的数字则\n是你所获得奖励的几倍。\n3.如果转盘指针和右侧抽奖机所指的幸运色不一致，所获得奖励不会翻\n倍，那么抽奖机所指奖励就是你所获得奖励。\n4.玩家每天有3次免费次数，免费次数0点重置。\n5.免费次数使用完后再次抽取将花费钻石（50钻石/次）",Icon="item_baoxiang_001",StartDate={Year=2016,Month=8,Day=13,},FrontStartDate={Year=2016,Month=8,Day=13,},StopDate={Year=2016,Month=8,Day=19,},FrontStopDate={Year=2016,Month=8,Day=19,},StartTime={Hour=0,Minute=0,Seconds=0,},StopTime={Hour=23,Minute=59,Seconds=59,},Days={1,2,3,4,5,6,7,},LevelRange={Start=1,End=99,},TotalCount="0",Reward={God=0,Gem=0,Reputation=0,Energy=0,Exp=0,Contribution=0,Score=0,},},
